B.Wz=new A.af("i. You acknowledge that (1) your cancellation, or attempted or purported cancellation of an order or (2) cancellation due to reasons not attributable to BadiDukkan, that is, in the event you provide incorrect particulars, contact number, delivery address etc., or that you were unresponsive, not reachable or unavailable for fulfillment of the services offered to you, shall amount to breach of your unconditional and irrevocable authorization in favor of BadiDukkan to place that order against the Restaurant Partners/Store(s) on your behalf (\u201cAuthorization Breach. In the event you commit an Authorization Breach, you shall be liable to pay the liquidated damages of an amount equivalent to the order value. You hereby authorize BadiDukkan to deduct or collect the amount payable as liquidated damages through such means as BadiDukkan may determine in its discretion, including without limitation, by deducting such amount from any payment made towards your next Order.\n\nii. There may be cases where BadiDukkan is either unable to accept your order or cancels the order, due to reasons including without limitation, technical errors, unavailability of the item(s) ordered, or any other reason attributable to BadiDukkan, Restaurant Partner/Store or Delivery Partner. In such cases, BadiDukkan shall not charge a cancellation charge from you. If the order is canceled after payment has been charged and you are eligible for a refund of the order value or any part thereof, the said amount will be reversed to you.\n\n iii. No replacement / refund / or any other resolution will be provided without Restaurant Partner\u2019s/Store(s)\u2019 permission.\n\niv. Any complaint, with respect to the order which shall include instances but not be limited to food spillage, foreign objects in food, delivery of the wrong order or food and beverages or Products, poor quality, You will be required to share the proof of the same before any resolution can be provided.\n\nv. You shall not be entitled to a refund in case instructions placed along with the order are not followed in the form and manner You had intended. Instructions are followed by the Restaurant Partner /Store on a best-efforts basis.\n\nvi. All refunds shall be processed in the same manner as they are received, unless refunds have been provided to You in the form of credits, refund amount will reflect in your account based on respective banks policies.\n\nV. If the customer is unable to accept order for any reason once the order placed and accepted, the same would be considered as cancelation of order, the order would be completely \n\nchargeable and the further orders of the customer would be accepted only on online or prepayment for the order placed and we reserve all the right to reject the order if refused by the customer to follow the above.\n\nvi. If the customer refuses to make the payment for the canceled order and has not placed the order since then for the period of 30 days the BadiDukkan reserves all rights to send the legal notice towards the same as it is considered as the customer\u2019s liability towards the company.\n\nvii. We request you to kindly check twice before placing the order, as once after you place the order you will only have 5 min to cancel it if not canceled within 5 min you will be liable to pay the full amount of the order as well as the service.",null,B.r,null,null,null,null,null,null)
